import Blog from './Blog'
const Blogs = (params) => {
    return (
        <div>
            <h2>B</h2>
            <ul>
                {params.blogs.map((blog) => <Blog key={blog.id} blog={blog}/> )}
            </ul>
        </div>
    )
}
export default Blogs
